var LoopAnimation = pc.createScript('loopAnimation');
LoopAnimation.attributes.add("entityType", { type: "string", title: "实体名称", default: '',});
LoopAnimation.attributes.add('isLoop', {type: 'boolean', title: '是否是循环动画', default: false, array: false});
LoopAnimation.attributes.add('animationName', {type: 'string', title: '动画名称', default: ''});
LoopAnimation.attributes.add('skeletonName', {type: 'string', title: '骨架名称', default: ''});
LoopAnimation.attributes.add('hotAnimation', {
  type: 'boolean',
  title: '热点是否需要动画',
  default: false,
});

// initialize code called once per entity
LoopAnimation.prototype.initialize = function() {

    // 初始化禁止函数调用
    this.playOpenDoorAnimation = undefined;
    // 监听open/coose 门事件
    this.app.on('openOrCloseDoor', this.addOn, this);
    // 对象销毁移除事件
    this.on('destroy', function() {
      this.app.off("openOrCloseDoor", this.addOn, this);
    }, this);
    this.animationIsInit = false;
    this.offSetDuration = 0;
    this.duration = 0;
    this.animationArrayLength = 0;
    this.animationNode = [];
    this.startEnulerAngles = this.entity.getLocalEulerAngles().clone();
};

// update code called every frame
LoopAnimation.prototype.update = function(dt) {
    
};

LoopAnimation.prototype.openAnimation = function() {
  this.getAnimation();
  this.createAnimation(false);
};

/**
 * 关门动画
 */
LoopAnimation.prototype.closeAnimation = function() {
  this.getAnimation();
  this.createAnimation(true);
};

/**
 * 事件监听
 */
LoopAnimation.prototype.addOn = function(arg) {
  if (arg.entityType.indexOf(this.entityType) !== -1) {
    arg.action === 'open' ? this.openAnimation() : this.closeAnimation();
  } 
};

/**
 * 获取动画
 */
LoopAnimation.prototype.getAnimation = function() {
  if (!this.animationIsInit) {
    let animation  = this.entity.animation.getAnimation(this.animationName);
    if (animation) {
      let nodeKeys = animation._nodes[0]._keys;
      this.animationNode = this.isLoop ? nodeKeys.slice(0, nodeKeys.length/ 2) : nodeKeys;
      this.duration = this.animationNode[this.animationNode.length -1].time;
      this.entity.removeComponent('animation');
      this.animationIsInit = true;
      this.animationArrayLength = this.animationNode.length;
    }
  }
};

LoopAnimation.prototype.createAnimation = function(isDesc) {
  let = currentDuration = currentIndex = 0;
  if (this.entity.animation) {
    currentDuration = this.entity.animation.currentTime;
    currentDuration =   Math.round(currentDuration * 10) / 10;
    if (currentDuration >= this.duration) {
      this.offSetDuration = currentDuration = this.entity.animation.currentTime =  0;
    }
    currentIndex = Math.round(currentDuration / 0.1);
  }
  this.entity.removeComponent('animation');
  let offset = this.offSetDuration + currentIndex;  
  let  node = new pc.Node();
  node._name = this.skeletonName;
  let newNodes = [];
  
  if (isDesc) {
    if (offset === 0) {
      offset = this.animationArrayLength;
    }
    newNodes = this.animationNode.slice(0, offset);
    newNodes.reverse();
  } else {
    if (offset >=  this.animationArrayLength) {
      offset = 0;
    }
    newNodes = this.animationNode.slice(offset);
  }
  // console.log(isDesc, this.offSetDuration, offset, currentIndex, newNodes, this.animationNode, 77777);
  this.offSetDuration = this.animationArrayLength - newNodes.length;
  // console.log( this.offSetDuration, 1000000);
  let startTime  = 0;
  let ss = [];
  newNodes.forEach((item) => {

    let newItem = {...item};
    newItem.time = Math.round(startTime * 10) / 10;
    ss.push(newItem);
    startTime += 0.1;
  });
  node._keys = ss;
  let anim = new pc.Animation();
  anim.name = 'myanim';
  anim.duration = startTime;
  anim.addNode(node);
  this.entity.addComponent('animation');
  this.entity.animation.loop =  false;
  this.entity.animation.animations = {
    'myanim': anim
  };
  this.entity.animation.setModel(this.entity.model.model);
  this.entity.animation.speed = 1;
  this.entity.animation.play('myanim');
};

